import './App.css';

function App() {
  const name = "RAMA";
  const email = "adit@ramp.com";

  const hname = <h1> name</h1>;
  const hemail = <h2> email</h2>;

  const user = (
    <div>
      {hname}
      {hemail}
    </div>
  );
  return (
    <div className="App">
      {user}
      {user}
      {user}
    </div>
  );
}

const GetName = () => {
  return "NAMA RAMA";
}

const GetNameComponent = () => {
  return <h1>NAMA RAMA COMPONENT</h1>
}

export default GetNameComponent;
